import { PropsWithChildren } from "react";

export type WorkExperience = {
    name: string
    location: string
    startDate: Date
    endDate: Date | null
    description: string
}

export function GridItem({children}: PropsWithChildren<{}>) {
    return (<div className=''>{children}</div>)
}

export function Title({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-semibold text-left px-5'>{children}</h2>)
}

export function LocationItem({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-medium text-right px-5'>{}</h2>)
}

export function WorkExperienceItem({workExp}:{workExp: WorkExperience}): JSX.Element & PropsWithChildren {
    return (<div className='grid grid-cols-2 bg-stone-800 text-slate-50'>
        <Title>{workExp.name}</Title>
        <LocationItem>{workExp.location}</LocationItem>
    </div>)
}
